import React, { Component } from 'react';

export default class LoginTest extends Component{
    render(){
        return(
            <div>
                <h2>
                    입력하신 이메일 주소 { email } 을 통해 인증을 진행해주세요.
                </h2>
            </div>
        );
    }
}
